import React from "react";
import ReactDOM from "react-dom";

const App = () => {
  return (
    <div className="ui container comments">
      <div className="comments">
        <a href="/" className="avater">
          <img src="" alt="avatar" />
        </a>
      </div>
    </div>
  );
};

export default App;

ReactDOM.render(<App />, document.querySelector("#root"));
